import React from 'react';
import { useAuth } from '../contexts/AuthContext';
import logoImage from '../assets/img/SignEd_logo.png';

const Header = ({ onNavigate, handleLogout }) => {
    return (
        <header className="w-full px-12 py-6 flex justify-between items-center bg-[#131b2e]">
            <div className="flex items-center">
                <img src={logoImage} alt="SignEd Logo" className="h-10 mr-2" />
                <span className="text-xl font-bold text-yellow-400">SignEd.</span>
                
                <nav className="ml-16 space-x-12">
                    <button 
                        onClick={() => onNavigate('help')} 
                        className="text-white hover:text-yellow-300 transition-colors text-lg"
                    >
                        Panduan
                    </button>
                    <button 
                        className="text-white hover:text-yellow-300 transition-colors text-lg"
                    >
                        Tentang
                    </button>
                </nav>
            </div>
            
            <button 
                onClick={handleLogout}
                className="px-6 py-2 text-white hover:text-yellow-300 transition-colors text-lg"
            >
                Logout
            </button>
        </header>
    );
};

const MainContent = ({ onNavigate }) => {
    return (
        <main className="w-full px-12 py-16 flex flex-col md:flex-row items-center bg-[#131b2e]">
            {/* Left Content - Text Section */}
            <section className="w-full md:w-1/2 md:pr-16">
                <div className="inline-flex items-center mb-4 text-blue-300">
                    <svg xmlns="http://www.w3.org/2000/svg" className="h-5 w-5 mr-2" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                        <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M9 5l7 7-7 7" />
                    </svg>
                    AI-Powered Calculator
                </div>
                <h1 className="text-5xl md:text-7xl font-bold mb-8 leading-tight">
                    SignEd Sign<br />
                    <span className="text-blue-400">Language</span><br />
                    Calculator
                </h1>
                <p className="text-gray-300 leading-relaxed text-lg mb-12 max-w-xl">
                    Sebuah aplikasi web inovatif berbasis kecerdasan buatan (AI)
                    yang dirancang untuk membantu penyandang tunarungu
                    dalam mempelajari matematika dasar secara interaktif.
                    Aplikasi ini menggunakan model YOLOv11 untuk deteksi
                    gestur tangan yang merepresentasikan angka dan
                    operasi aritmatika.
                </p>
                <button 
                    onClick={() => onNavigate('calculator')}
                    className="px-12 py-4 bg-blue-600 hover:bg-blue-700 rounded-lg font-semibold text-lg transition-all duration-300"
                >
                    Coba Sekarang
                </button>
            </section>
            
            {/* Right Content - Camera Section */}
            <section className="w-full md:w-1/2 mt-12 md:mt-0">
                <div className="w-full aspect-video bg-[#1a2338] rounded-lg overflow-hidden flex items-center justify-center relative">
                    <img 
                        src="https://placeholder-for-your-image.com/camera-image" 
                        alt="AI Detection" 
                        className="w-full h-full object-cover"
                    />
                    
                    {/* Camera indicator */}
                    <div className="absolute top-4 right-4 flex items-center bg-[#131b2e]/80 px-3 py-1 rounded-full">
                        <span className="w-2 h-2 rounded-full bg-red-500 mr-2 animate-pulse"></span>
                        <span className="text-white text-sm">Recording</span>
                    </div>
                </div>
                
                {/* Status information - simplified */}
                <div className="mt-6 flex space-x-4">
                    <div className="flex items-center">
                        <span className="w-2 h-2 rounded-full bg-green-400 mr-2"></span>
                        <p className="text-white">Deteksi Siap</p>
                    </div>
                    <div>
                        <p className="text-white">Webcam Default</p>
                    </div>
                </div>
            </section>
        </main>
    );
};

const HomePage = ({ onNavigate }) => {
    const { currentUser, logout } = useAuth();
    
    const handleLogout = () => {
        logout();
        onNavigate('landing');
    };
    
    return (
        <div className="min-h-screen bg-[#131b2e] text-white">
            <Header onNavigate={onNavigate} handleLogout={handleLogout} />
            <MainContent onNavigate={onNavigate} />
        </div>
    );
};

export default HomePage;
